function NumericText(){var n=window.event.keyCode;(n<48||n>57)&&(window.event.returnValue=!1)}function someFunc(){google.charts.load("current",{packages:["corechart"]});google.charts.setOnLoadCallback(drawChart)}function drawChart(){var n=document.getElementById("name").value,t=document.getElementById("x1").value,i=document.getElementById("x2").value,r=document.getElementById("x3").value,u=google.visualization.arrayToDataTable([["Year",n],["2004",Number(t)],["2005",Number(i)],["2006",Number(r)]]),f=new google.visualization.LineChart(document.getElementById("curve_chart"));f.draw(u,{title:"Result",curveType:"function",legend:{position:"bottom"}})}